import { CARD } from "./CaseStudyCardInfo/caseConstants";
import CaseStudyCard from "./CaseStudyCardInfo/CaseStudyCard";

export default function CaseStudy() {
  return (
    <div>
      <div className="border-b border-solid border-b-gray-400">
        <div className="flex justify-between text-white text-xs pl-5 mt-10 font-bold">
            <h6>/Case Studies</h6>
            <div className="flex justify-end pr-44 text-blue-500 text-lg w-screen h-5 mt-7">
                <p className="hover:cursor-pointer">Arrows here</p>
            </div>
        </div>
        <div className="flex flex-col justify-around align-top w-full h-3/4 pb-14 pt-7 mx-auto">
          <div className="grid grid-flow-col overflow-scroll text-2xl">
            {CARD.map((card) => (
              <CaseStudyCard
                key={card.key}
                image={card.img}
                header={card.header}
                alt={card.alt}
              />
            ))}
          </div>
        </div>
        <div className="flex justify-center pb-14">
          <button className="text-white text-base px-4 py-2 font-bold bg-black border border-solid border-blue-500 rounded-lg hover:bg-blue-500 hover:text-white">
            Our Portfolio
          </button>
        </div>
      </div>
    </div>
  );
}
